import React, { Component } from "react";

class Logged extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <h1> Welcome! You are logged in! </h1>
      </div>
    );
  }
}

export default Logged;
